	<h1 class="mb-4">FAQ/About</h1>
	<p>
		<span class="tds-text--bold">How to add / install the wrap?</span> - follow
		<a class="tds-link" href="https://github.com/teslamotors/custom-wraps/">this guide by Tesla</a>
	</p>
	<p>
		<span class="tds-text--bold">How to add your wrap to the gallery?</span> - follow
		<a class="tds-link" href="https://github.com/core-hacked/tesla-custom-wraps-gallery"
			>this guide by me</a
		>
	</p>
	<p>
